package com.markelytics.android.model;public class DashboardDetail{	String date, description, points;	public String getDate() {		return date;	}	public void setDate(String date) {		this.date = date;	}	public String getDescription() {		return description;	}	public void setDescription(String description) {		this.description = description;	}	public String getPoints() {		return points;	}	public void setPoints(String points) {		this.points = points;	}		}